【内容量】456g<br><br>
【原産国】イタリア<br><br>
【原材料】食用オリーブ油<br><br>
【注意事項】<br>
・低温でにごりや固まりを生じることがありますが、オリーブオイルの成分です。ビンをぬるま湯で温めるともとに戻ります。<br>
・光や空気にさらされると退色したり風味が変わります。高温を避け、暗い所に保存し、開封後はなるべく早くご使用下さい。<br>
・黒っぽいにごりや沈澱を生じることがありますが、オリーブオイル由来の成分です。安心してご使用下さい。<br>
・油を加熱しすぎると発火します。揚げ物の際、その場を離れるときは必ず火を消しましょう。<br>
・使用後にキャップを取り外す際、指のケガや油ハネにご注意下さい。<br><br>
【製造元】日清オイリオ<br><br>
【商品区分】食品<br><br>
