十和田湖の恵み、奥入瀬の清流にはぐくまれた水はまろやかな水で美味しさが違います！<br>
 特殊な製法で高濃度の水素を水の中に溶かし込んで作られている水素水です♪<br>

イキイキとした毎日をおくりたい方におすすめいたします。<br><br>
■疲れがとれにくい方　■偏食気味等、栄養バランスの良くない方　■食べ過ぎ、飲み過ぎの方　■むくみやすい方　■体の中からキレイになりたい方　■お腹周りが気になる方　■しみ、しわ等、お肌の調子が気になる方<br><br>

原材料：水、水素<style type="text/css">
