【キリン アルカリイオンの水 大型容器の詳細】<br>
キリン アルカリイオンの水は、飲んでおいしい、料理においしい、カラダにおいしい、家族のからだにやさしい、口あたりまろやかなおいしいお水です。<br><br>

【原材料】<br>
水（鉱水）<br><br>

【栄養成分】100ml当たり<br>
エネルギー（kcal）：0、たんぱく質（g）：0、脂質（g）：0、炭水化物（g）：0、食塩相当量（g）：0.002、ナトリウム（mg）：0.8、カリウム（mg）：0.16、カリウム 0.16mg、カルシウム 1.3mg、マグネシウム 0.64mg、硬度 59mg/L、pH 8.8～9.4　【岐阜県岐阜市製造品　栄養成分情報】ｴﾈﾙｷﾞｰ(kcal)：0、たんぱく質(g)：0、脂質(g)：0、ﾅﾄﾘｳﾑ(mg)：1.0、ﾘﾝ(mg)：0.005、ｶﾘｳﾑ：0.12mg、ｶﾙｼｳﾑ：1.5mg、ﾏｸﾞﾈｼｳﾑ：0.43mg、硬度：55mg/L<br><br>

